import ListaConsulta from './ListaConsulta'
import React from 'react'
try{
    const enquiries = (await axios.get('http://localhost:5000/enquiries')).data;
}catch(error){
    console.log(error);
}
function HomeConsultas(){
    return(
        <div>
            <ListaConsulta enquiries = {enquiries} />

        </div>
    );
}

export default HomeConsultas;
